import React, { useEffect } from 'react';
import AOS from 'aos';
import "../style.scss"
import Hi from "./HI";

const Home = (props) => {
    useEffect(() => {
        AOS.init({
            duration: 1200,
        });
    }, []);

    return (
        <div id="home">
            <section className="one">
                <h1 className="hero-heading">Hi,<br/>Bonjour</h1>
                <div className="container-presentation">
                    <p className="home-text">Etudiant en informatique depuis 4 ans, junior développeur. Je me passionne
                        depuis petit pour les nouvelles technologies, le Développement Durable et les avancées
                        techniques de ce secteur.<br/>J'ai eu l'opportunité d'accomplir, durant ma scolarité
                            et sur mon temps libre, de réaliser de nombreux projets de programmation sur différent
                            supports : Application mobile, logiciel, web, système, réseau.<br/>L'enseignement reçu au
                                cours de mon parcours en Grande Ecole du Numérique, m'a permis
                                d'acquérir une rigeur d'architecture de programmation, une autonomie dans la recherche
                                et la transmission de l'information, un calme et une patience à toute épreuve. J'y ai
                                aussi pu forger et nourir ma curiosité en m'entourant de personnes
                                passionnées et passionnantes.</p>
                    <img src="../../assets/img/home-profil.jpg" className="home-img" alt="oups"/>
                </div>
            </section>
            <section className="two">
                <h1 className="has-text-weight-bold">Page Two</h1>

            </section>
            <section className="three">Page Three</section>
            <section className="four">Page Four</section>
            <section className="five">Page Five</section>
        </div>
    );
};

export default Home;
